import{_ as t}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as i,e as a}from"./app-1c5b5ce3.js";const g={},r=a('<p>今天给大家分享一本个人最近看过觉得非常不错的Git开源手册，可能有些小伙伴也看过了，我是最近在通勤路上用PAD看的。这本开源手册，它除了有<strong>PDF版</strong>，还有<strong>epub电子书版</strong>，非常适合电子阅读，有需要的小伙伴可以在文末自行下载：</p><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/git/progit-01.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>相信看完对于个人Git知识体系的梳理和掌握是非常有帮助的。</p><p>这本手册在豆瓣上评价极高，之前9.3，现在也有9.1的高分，其作者是GitHub的员工，内容主要侧重于各种场合中的惯用法和底层原理的讲述，手册中还针对不同的使用场景，设计了几个合适的版本管理策略。简而言之，这本手册无论是对于初学者还是想进一步了解Git工作原理的开发者都非常合适。</p><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/git/progit-02.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/git/progit-03.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>这个手册一共分为十章，详细内容如下：</p><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/git/progit-04.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p><strong>手册中部分内容展示如下：</strong></p><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/git/progit-05.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/git/progit-06.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/git/progit-07.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/git/progit-08.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p><strong>需要该Git手册PDF+epub电子书的小伙伴：</strong></p><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/git/progit-09.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>可直接长按扫码关注下方二维码，回复 「<strong>git</strong>」 即可下载：</p><figure><img src="https://cdn.tobebetterjavaer.com/tobebetterjavaer/images/itwanger.png" alt="（长按扫码识别）" tabindex="0" loading="lazy"><figcaption>（长按扫码识别）</figcaption></figure><p>好了，这次资源分享就到这里！后续如果遇到有用的工具或者资源，依然还会持续分享，也欢迎大家多多安利和交流，一起分享成长。</p><p>以上，我们下篇见。</p>',19),o=[r];function n(p,c){return e(),i("div",null,o)}const f=t(g,[["render",n],["__file","progit.html.vue"]]);export{f as default};
